import React from 'react'

const Response = ({name, rollno, classLocation, responseLocation}) => {
  return (
    <div className='container row p-3 m-2' style={{borderRadius: "4px", backgroundColor: "white"}}>
    <div className='col'>{name}</div>
    <div className='col'>{rollno}</div>
    { classLocation.latitude == responseLocation.latitude && classLocation.longitude == responseLocation.longitude ? 
      <div className='col'></div>    :
      <div className='col'></div>
    }
    </div>
  )
}

export default Response
